import React, {Component} from 'react';
import Particles from 'react-particles-js';

import SiteHeader from "./SiteHeader";
import SiteFooter from "./SiteFooter";
import Landing from "./Landing";
import PartcileComponent from "./PartcileComponent";

class App extends Component {
    constructor(props) {
        super(props);

    }

    render() {
        return(
              <div>
                <SiteHeader />
                <Particles
                  params={{
              	    "particles": {
              	        "number": {
              	            "value": 50
              	        },
              	        "size": {
              	            "value": 3
              	        }
              	    },
              	    "interactivity": {
              	        "events": {
              	            "onhover": {
              	                "enable": true,
              	                "mode": "repulse"
              	            }
              	        }
              	    }
              	}} />
                <Landing />
                <SiteFooter />
              </div>
          );
    }
}

export default App;
